import React from "react";
import "./LeaderboardView.css";
import { Switch, Route, withRouter, Link } from "react-router-dom";

class LeaderboardPost extends React.Component {
  constructor(props) {
    super(props);
  }

  componentDidMount = () => {};

  render() {
    return (
      <div className="container">
        <h1>Leaderboard</h1>
        <h2>The top players are:</h2>
        <Link to="/">
          <p>
            {this.props.leaders[0].Name}: {this.props.leaders[0].Streak}.
          </p>
          <p>
            {this.props.leaders[1].Name}: {this.props.leaders[1].Streak}.
          </p>
          <button className="buttonstyle">Back</button>
        </Link>
      </div>
    );
  }
}

export default LeaderboardPost;
